import Head from "next/head";
import Navbar from "./Navbar";

const Layout = (props) => {
  return (
    <>
      <Head>
        <title>To Do App</title>
        <link
          rel="stylesheet"
          href="https://bootswatch.com/4/cerulean/bootstrap.min.css"
        />
      </Head>
      <style jsx>
        {`
          .main {
            height: 100vh;
            background: #060b1e;
          }
        `}
      </style>
      {/* <Navbar /> */}
      <div className="main">
        <h3>To Do App</h3>
        <h6>by Jericho Aldemo</h6>
        {props.children}
      </div>
    </>
  );
};

export default Layout;
